import FeedCard from './FeedCard'
export default function Feed({data, type}) { //type can be used to switch update/news
    const feedData = data || Array(20).fill({})
    const cards = feedData.map(() => <FeedCard/>)
    const grid = `w-full overflow-x-scroll grid grid-rows-2 grid-cols-${feedData.length/2} col-gap-64 no-scrollbar grid-flow-row no-wrap`
    return(
        <div className={grid}>
            {cards}
        </div>
    )
}
